import React from 'react'
import "./Toggle.css"
import Sun from "@iconscout/react-unicons/icons/unil-sun"
import Moon from "@iconscout/react-unicons/icons/unil-moon"
export const Toggle = () => {
  return (
   <div className="toggle">
       <Sun/>
       <Moon/>
   </div>
  )
}
